import React from "react";
const Button = ({ Colors, sethandler }) => {
  const handleChange = () => {
    let cgColor = " ";
    for (let i = 0; i < 6; i++) {
      cgColor += Colors[Math.floor(Math.random() * 16)];
    }
    sethandler(`#${cgColor}`);
  };
  return (
    <>
      <button onClick={handleChange}>bgchange</button>
    </>
  );
};
export default Button;
